import React from 'react';
import { useState, useEffect } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Link } from 'react-router-dom';
import Axios from 'axios';


const Home = () => {
	const ButtonEvents = () => {
		alert("Welcome to Burger N' Bite. You're going to another tab.");
	};

	const ButtonEvents2 = (data) => {
		console.log(data + ' Order Now.');
	};

	const [getData, setData] = useState(' ');

	const ButtonEvents3 = (data1) => {
		setData(data1 + ' with Free Shipping');
	};

	const [getUser, setUser] = useState('');
	const [getPass, setPass] = useState('');
	const [getUserlist, setUserlist] = useState('');

	const mystyle = {
		textAlignn: 'center',
		marginTop: '1700px',
		marginBottom: '500px',
	};


const style2 = {
	color: 'red',
	fontFamily: 'sans-serif',
	fontSize: '23px',
	backgroundColor: 'transparent',
	textAlign: 'center',
	display: 'inline-block',
	padding: '0.5em 3em',
	border: '0.16em solid #FFFFFF',
	margin: '0 0.3em 0.3em 0',
	boxSizing: 'border-box',
	textDecoration: 'none',
	textTransform: 'uppercase',
};


	useEffect(() => {
		Axios.get('http://localhost:3001/get').then((response) => {
			setUserlist(response.data);
		});
	}, []);

	const handleSubmit = (e) => {
		e.preventDefault();
		Axios.post('http://localhost:3001/insert', {
			username: getUser,
			password: getPass,
		}).then((response) => {
			alert('Insert Successfully');
		});
	};

	return (
		<div>
			<div className='site-info'>
				<div className='title' onClick={() => ButtonEvents2('So Delicious!')}>
					Burger N' Bite
				</div>
				<div
					className='sub-title'
					onClick={() => ButtonEvents3('Cash on Delivery')}
				>
					Grilled To Perfection | Dare To Take Another Bite<br></br>
					{getData}
					<div>
						<br></br>
						<Link className='nav-link' to='/menu'>
							<button type='button' className='buttonw' onClick={ButtonEvents}>
								Order Now
							</button>
						</Link>

						<br />
						<p>OR</p>
						<br />

						<a href='#sign'><button type='button' className='btn btn-primary' style={style2}>SIGN UP</button></a>
					</div>
				</div>
			</div>

		<div style={mystyle}><a name="sign"><h3>Signup Now</h3>
</a>
			<div className='container p-8 my-2 '>
				<div className='btn-group-vertical'>
					<form onSubmit={handleSubmit}>
						<div>
							<div className='input-group mb-3'>
								<span className='input-group-text'>Username:</span>
								<input
									type='text'
									className='form-control'
									value={getUser}
									onChange={(e) => setUser(e.target.value)}
								/>
							</div>

							<div className='input-group mb-14'>
								<span className='input-group-text'>Password:</span>
								<input
									type='password'
									className='form-control'
									value={getPass}
									onChange={(e) => setPass(e.target.value)}
								/>
							</div>

							<div className='col-58'>
								<button
									id='Popover1'
									type='submit'
									className='button1'
									onfocus="this.value=''"
									data-bs-toggle='popover'
									data-bs-content='Some content inside the popover'
								>
									Submit
								</button>
							</div>
						</div>
					</form>


					</div>
				</div>
		</div>


			</div>

	);
};

export default Home;
